/**
 * Helper function to convert score ranges (e.g., "10-12") into a direct lookup object.
 * @param {object} ranges - An object with range strings as keys and scores as values.
 * @returns {object} A lookup object where each individual score is a key.
 */
const _generateLookup = (ranges) => {
    const lookup = {};
    for (const key in ranges) {
        const score = ranges[key];
        if (key.includes('-')) {
            const [start, end] = key.split('-').map(Number);
            for (let i = start; i <= end; i++) {
                lookup[i] = score;
            }
        } else {
            lookup[Number(key)] = score;
        }
    }
    return lookup;
};

/**
 * Helper function to convert arrays of composite scores into a direct lookup object.
 * @param {Array<Array>} dataArray - Array of arrays with composite data.
 * @returns {object} A lookup object keyed by the sum of weighted scores.
 */
const _generateCompositeLookup = (dataArray) => {
    const lookup = {};
    dataArray.forEach(row => {
        const [sum, composite, percentile, ci_90, ci_95] = row;
        lookup[sum] = { composite, percentile: String(percentile).replace(/,/g, '.'), ci_90, ci_95 };
    });
    return lookup;
};

/**
 * [CORRIGIDO] Classifica um ponto ponderado de subteste de acordo com a imagem de exemplo.
 * @param {number} score - O ponto ponderado.
 * @returns {string} A classificação do subteste.
 */
const _classifyWeightedScore = (score) => {
    if (score >= 13) return 'Média Superior';
    if (score >= 8) return 'Média';
    if (score >= 6) return 'Dificuldade Leve';
    if (score >= 4) return 'Dificuldade Moderada';
    if (score >= 1) return 'Dificuldade Grave';
    return '';
};


