    _getAgeGroupKey: function(age) {
        if (!age || typeof age.years !== 'number' || typeof age.months !== 'number') return null;

        const keyMap = {
            "6_8-6_11": [80, 83], "7_0-7_3": [84, 87], "7_4-7_7": [88, 91],
            "7_8-7_11": [92, 95], "8_0-8_3": [96, 99], "8_4-8_7": [100, 103],
            "8_8-8_11": [104, 107], "9_0-9_3": [108, 111], "9_4-9_7": [112, 115],
            "9_8-9_11": [116, 119], "10_0-10_3": [120, 123], "10_4-10_7": [124, 127],
            "10_8-10_11": [128, 131], "11_0-11_3": [132, 135], "11_4-11_7": [136, 139],
            "11_8-11_11": [140, 143], "12_0-12_3": [144, 147], "12_4-12_7": [148, 151],
            "12_8-12_11": [152, 155], "13_0-13_3": [156, 159], "13_4-13_7": [160, 163],
            "13_8-13_11": [164, 167], "14_0-14_3": [168, 171], "14_4-14_7": [172, 175],
            "14_8-14_11": [176, 179], "15_0-15_3": [180, 183], "15_4-15_7": [184, 187],
            "15_8-15_11": [188, 191], "16_0-16_3": [192, 195], "16_4-16_7": [196, 199],
            "16_8-16_11": [200, 203]
        };
        const totalMonths = age.years * 12 + age.months;
        for (const key in keyMap) {
            if (totalMonths >= keyMap[key][0] && totalMonths <= keyMap[key][1]) {
                return key;
            }
        }
        return null;
    },

    getWeightedScore: function(subtestId, rawScore, age) {
        const ageKey = this._getAgeGroupKey(age);
        const score = parseInt(rawScore, 10);

        if (!ageKey || isNaN(score) || !this.data.weightedScoreTables[ageKey]?.[subtestId]) {
            return { weighted: '', classification: '' };
        }
        
        const table = this.data.weightedScoreTables[ageKey][subtestId];
        const weighted = table[score] !== undefined ? table[score] : '';
        const classification = _classifyWeightedScore(weighted);

        return { weighted, classification };
    },
    
    getCompositeScore: function(scaleId, sum) {
        const sumOfScores = parseInt(sum, 10);
        if (isNaN(sumOfScores) || !this.data.compositeScoreTables[scaleId] || !this.data.compositeScoreTables[scaleId][sumOfScores]) {
            return { composite: '', percentile: '', ci_90: '', ci_95: '', classification: '' };
        }
        const result = this.data.compositeScoreTables[scaleId][sumOfScores];
        let classification = 'Inválido';

        for (const c of this.data.classification) {
            if (result.composite >= c.limit) {
                classification = c.desc;
                break;
            }
        }
        // Tratamento especial para corresponder à terminologia da imagem
        if(scaleId === 'organizacaoPerceptual' && result.composite <= 69) {
            classification = 'Pontuação Extremamente Baixa';
        }

        return { ...result, classification };
    }
